$(function(){$.ajax({url:"/getStudentData"}).done(function(a){for(var b=a,c=0;c<b.length;c++){for(var d="",e=b[c].description,f=0;c<e[f].length;f++){var g=$("<li class='bulletList'>"+b[c].description[f]+"</li>");$(".desList").append(g)}var h=$("<div class='item'><p>"+b[c].name+"</p><p>"+d+"</p><p>"+b[c].shoutout+"</p></div>");$(".carousel-inner").append(h)}})});